jQuery(document).ready(function(){wp.customize.control.each(function(e){if(e.params&&e.params.preset&&!_.isEmpty(e.params.preset)){wp.customize(e.id,function(t){t.bind(function(i){_.each(e.params.preset,function(t,e){if(e===i){_.each(t.settings,function(t,e){kirkiSetSettingValue.set(e,t)})}})})})}})});